const ProductTable = () => {
  return (
    <div className="table-container">
      <table className="table">
        <tr>
          <th> Product </th>
          <th> Price </th>
          <th> Quantity </th>
          <th> Description </th>
          <th> Action </th>
        </tr>
      </table>
      <style jsx>{`
        .table-container {
          padding: 2rem 0;
        }
        .table {
          width: 100%;
        }

        .table th {
          font-size: 2rem;
          font-weight: 600;
          border-bottom: var(--color-dark);
        }
      `}</style>
    </div>
  );
};

export default ProductTable;
